import { useDispatch } from "react-redux";
import { keysAction } from "../../store/keys";

import classes from "./KeyInput.module.css";

const KeyInput = () => {
  const dispatch = useDispatch();
  const inputEl = useRef(null);

  const addKeyHandler = (event) => {
    event.preventDefault();

    console.log(inputEl.current.focus());
    const keyId = Math.trunc(Math.random() * 1000);
    // dispatch(keysAction.addKey({ id: keyId, content: keyContent }));
    // console.log(keyContent);
  };

  return (
    <form className={classes.add__keys}>
      <input
        onChange={addKeyHandler}
        type="text"
        placeholder="Add keys"
        ref={inputEl}
      />
    </form>
  );
};

export default KeyInput;
